Arsen (As, łac. arsenicum) – pierwiastek chemiczny z grupy azotowców o właściwościach metaloidu. Arsen i jego związki są silnie trujące. Występuje w skorupie ziemskiej w ilości 2,5 ppm (zajmując 20. miejsce pod względem rozpowszechnienia wśród pierwiastków). Tworzy ponad 200 minerałów, z których najbardziej rozpowszechnione są: arsenopiryt, lelingit, aurypigment, realgar. Często towarzyszący także złożom siarczkowym innych metali, np. pirytom, chalkopirytom, galenie, blendzie cynkowej. W naturze arsen występuje również w stosunkowo dużej liczbie związków arsenoorganicznych. Są to np. kwas kakodylowy i inne kwasy arsenoorganiczne, organiczne pochodne arsyny, arsenowe analogi biocząsteczek, np. lub . Do naturalnych źródeł arsenu w przyrodzie zalicza się erupcje wulkanów (około 17 000 ton rocznie) oraz (w mniejszym stopniu) ługowanie arsenu ze skał osadowych i magmowych. Jako źródła antropogeniczne wymienia się: uboczną emisję w wyniku procesów wydobycia i hutnictwa rud metali nieżelaznych (około 61 000 ton rocznie), spalanie paliw kopalnianych (głównie węgla brunatnego i kamiennego). Łączne wydobycie arsenu na świecie wynosi około 35 000 ton (w przeliczeniu na As2O3), z czego jedynie 3% stanowi czysty metal. Największymi jego wydobywcami są Chiny (około 50% światowego wydobycia) i Chile (25%). Metaliczny arsen uzyskuje się głównie na 2 sposoby: poprzez rozkład arsenopirytu lub lelingitu w temperaturze 650–700 °C; poprzez redukcję arszeniku węglem lub tlenkiem węgla. Arsen ma dwie odmiany alotropowe: 
* α – jest kruchym metalem, który matowieje w kontakcie z powietrzem i silnie reaguje z wodą; 
* β – jest żółtym, bezpostaciowym proszkiem, dużo mniej reaktywnym od odmiany α.
